'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/study-network/docs/appendix/tutorial/','title':"教程",'content':"教程 基础 进阶 高阶 "});index.add({'id':1,'href':'/study-network/docs/basic/','title':"第一部分 基础入门",'content':""});index.add({'id':2,'href':'/study-network/docs/basic/practice/spec/','title':"编程规范",'content':"编程规范 "});index.add({'id':3,'href':'/study-network/docs/appendix/interview/basic/','title':"基础",'content':"基础面试题 "});index.add({'id':4,'href':'/study-network/docs/design/','title':"第二部分 设计",'content':""});index.add({'id':5,'href':'/study-network/docs/appendix/interview/advanced/','title':"进阶",'content':"进阶面试题 "});index.add({'id':6,'href':'/study-network/docs/source/','title':"第三部分 源码实现",'content':""});index.add({'id':7,'href':'/study-network/docs/appendix/interview/expert/','title':"高阶",'content':"高阶面试题 "});index.add({'id':8,'href':'/study-network/docs/appendix/','title':"第四部分 附录",'content':""});index.add({'id':9,'href':'/study-network/docs/basic/protocol/tls/mtls/','title':"mTLS",'content':"mTLS "});index.add({'id':10,'href':'/study-network/docs/basic/protocol/tls/','title':"TLS",'content':"TLS "});index.add({'id':11,'href':'/study-network/docs/appendix/attention/','title':"关注",'content':"关注 其他 netty/netty Netty project - an event-driven asynchronous network application framework http://netty.io/\nlibuv/libuv Cross-platform asynchronous I/O https://libuv.org/\npanjf2000/gnet gnet 是一个基于事件驱动的高性能和轻量级网络框架。它直接使用 epoll 和 kqueue 系统调用而非标准 Go 网络包：net 来构建网络应用，它的工作原理类似两个开源的网络库：netty/netty 和 libuv/libuv 。\ngnet 设计开发的初衷不是为了取代 Go 的标准网络库：net，而是为了创造出一个类似于 antirez/redis 、haproxy/haproxy 能高效处理网络包的 Go 语言网络服务器框架。\ngnet 的卖点在于它是一个高性能、轻量级、非阻塞的纯 Go 实现的传输层（TCP/UDP/Unix Domain Socket）网络框架，开发者可以使用 gnet 来实现自己的应用层网络协议 (HTTP、RPC、Redis、WebSocket 等等)，从而构建出自己的应用层网络应用：比如在 gnet 上实现 HTTP 协议就可以创建出一个 HTTP 服务器 或者 Web 开发框架，实现 Redis 协议就可以创建出自己的 Redis 服务器等等。\ngnet 衍生自另一个项目：tidwall/evio ，但拥有更丰富的功能特性，且性能远胜之。\ntidwall/evio Fast event-loop networking for Go\n"});index.add({'id':12,'href':'/study-network/docs/basic/protocol/','title':"协议",'content':"协议 "});index.add({'id':13,'href':'/study-network/docs/appendix/interview/','title':"面试题",'content':"面试题 基础题 进阶题 高阶题 "});index.add({'id':14,'href':'/study-network/docs/basic/practice/','title':"实践",'content':"实践 "});index.add({'id':15,'href':'/study-network/docs/','title':"Docs",'content':""});})();